// Toggle sidebar
 $('#sidebarCollapse').on('click', function () {
       $('#sidebar').toggleClass('active');
 });
 $('.mob_btn').on('click', function () {
        $('#sidebar').toggleClass('show');
        $('#sidebar').removeClass('active');
});
$(document).click(function (e) {
    e.stopPropagation();
    var container = $("#sidebar.show");
    var container2 = $(".mob_btn");
    var width = $(window).width();
    //check if the clicked area is dropDown or not
    if (container.has(e.target).length === 0 && container2.has(e.target).length === 0 && width<=992) {
        $('#sidebar').removeClass('show');
    }else{
    	//$('#sidebar').show();
    }
})

   // find active link in sidebar
    var pgurl = window.location.href.substr(window.location.href);
    $('#sidenav-main ul li a').each(function() {
 	 if($(this).attr("href")==pgurl){
        	$(this).addClass("active");
        	if($(this).parent().parent().hasClass('list-unstyled')==true){
        		$(this).parent().parent().addClass('show');
        		$(this).parent().parent().parent().addClass('active');
        	}
        }
    })
